import React from 'react';
import './NewHangouts.css';
import {Link} from 'react-router-dom';

export const NewHangouts = () => {
    return (
    <div>
         <Link to="/newHangouts" className="btn btn-success btn-sm col-sm-1">Create a new Hangout</Link>
         </div>
    );
}
